import{_ as e,o as t,c as a,O as s}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 63.2-601.1 Temporary Assistance for Needy Families Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-601.1.md","filePath":"vacode/63.2-601.1.md"}'),n={name:"vacode/63.2-601.1.md"},r=s('<h1 id="§-63-2-601-1-temporary-assistance-for-needy-families-fund-established" tabindex="-1">§ 63.2-601.1 Temporary Assistance for Needy Families Fund established. <a class="header-anchor" href="#§-63-2-601-1-temporary-assistance-for-needy-families-fund-established" aria-label="Permalink to &quot;§ 63.2-601.1 Temporary Assistance for Needy Families Fund established.&quot;">​</a></h1><p>A. There is hereby created in the state treasury a special nonreverting fund to be known as the Temporary Assistance for Needy Families Fund, hereafter referred to as &quot;the Fund.&quot; The Fund shall be established on the books of the Comptroller. All donations and contributions to the Fund and such moneys as shall be appropriated by the General Assembly shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used solely for the purposes set forth in this section. Moneys in the Fund shall be used to:</p><ol><li><p>Supplement the assistance provided through the Department&#39;s administration of the Temporary Assistance for Needy Families block grant; and</p></li><li><p>Assist the Commonwealth in maximizing the amount of funds available to serve the stated purposes of the TANF program by leveraging individual, corporate, and charitable donations.</p></li></ol><p>B. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Commissioner. Up to 10 percent of the Fund may be used to pay the Department&#39;s expenses in administering the Temporary Assistance for Needy Families Program.</p><p>C. The Department shall administer the Fund in accordance with the provisions of this section.</p><p>2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0004" target="_blank" rel="noreferrer">4</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>.</p>',6),i=[r];function o(d,l,h,p,c,m){return t(),a("div",null,i)}const b=e(n,[["render",o]]);export{f as __pageData,b as default};
